      <p>In this Spring 2022 semester, I am attending below classes and each class has 3 credits. Below are the core subjects which are prerequisites for the remaining subjects that I am going to take in the furture semesters.
        <ul>
          <li>Database Management Systems</li>
          <li>Concepts and Structures in Internet Computing</li>
          <li>Algorithms and Computing Theory</li>
        </ul>
        My facourite subjects are Concepts and Structures in Internet Computing and Algorithms and Computing Theory because these are new New Concepts which I am excited to learn.
      </p>
    </div>;
    }
}
export default MainPage;
